INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("ヤマト", 100, 130011, 2.1, 3001100, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 0.0, 3001, "2030/01/01 14:59:59", -416.5, 1, "2024/10/31 12:00:00", 2);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("ヤマト", 101, 130011, 5.68, 3001101, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 0.0, 3001, "2030/01/01 14:59:59", -416.5, 4, "2024/10/31 12:00:00", 2);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("ヤマト", 102, 130011, 0.0, 3001102, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 0.0, 3001, "2030/01/01 14:59:59", -416.5, 1, "2024/10/31 12:00:00", 1);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("フブキ", 100, 130211, 0.0, 3002100, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 0.0, 3002, "2030/01/01 14:59:59", -416.5, 1, "2024/10/31 12:00:00", 1);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("フブキ", 101, 130211, 0.0, 3002101, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 0.0, 3002, "2030/01/01 14:59:59", -416.5, 1, "2024/10/31 12:00:00", 1);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("フブキ", 102, 130211, 8.53, 3002102, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 0.0, 3002, "2030/01/01 14:59:59", -416.5, 5, "2024/10/31 12:00:00", 2);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("フブキ", 103, 130211, 5.67, 3002103, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 0.0, 3002, "2030/01/01 14:59:59", -416.5, 7, "2024/10/31 12:00:00", 1);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("フブキ", 104, 130211, 0.0, 3002104, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 0.0, 3002, "2030/01/01 14:59:59", -416.5, 1, "2024/10/31 12:00:00", 1);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("フブキ", 300, 130211, 0.0, 3002300, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 0.0, 3004, "2030/01/01 14:59:59", -416.5, 3, "2024/10/31 12:00:00", 3);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("フブキ", 301, 130211, 0.0, 3002400, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 0.0, 3005, "2030/01/01 14:59:59", -416.5, 7, "2024/10/31 12:00:00", 7);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("フブキ", 200, 130211, 4.4, 3003200, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 0.0, 3003, "2030/01/01 14:59:59", -416.5, 2, "2024/10/31 12:00:00", 1);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("フブキ", 201, 130211, 0.0, 3003201, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 0.0, 3003, "2030/01/01 14:59:59", -416.5, 7, "2024/10/31 12:00:00", 7);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("フブキ", 202, 130211, 5.6, 3003202, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 0.0, 3003, "2030/01/01 14:59:59", -416.5, 1, "2024/10/31 12:00:00", 2);
